}

}

        background-color: rgb(1, 65, 65);

        color: #00ffcc;

<body>
    <div id="container">
        <h1 id="h">Hemşirelik Puanları</h1>
        <table>
            <thead>
                <tr>
                    <th>Şehir</th>
                    <th>Hastane</th>
                    <th>Kontejyan</th>
                    <th>Üst Puan</th>
                    <th>Alt Puan</th>
                </tr>
            </thead>
            <tbody id="by">
               
            </tbody>
        </table>
    </div>
<div id="circ"></div>
<h2><i><b>MÜFTÜ</b></i> tarfından yaratıldı</h2>
    <script>
        let voidPoint = 0;
        const getPoint = () => {
            let pp1 = prompt("Puanınızı giriniz");
            pp1 = pp1.replace(",",".");
            pp1 = Number(pp1);
            if(isNaN(pp1)){
                alert("Verdiğiniz değer NaN tipinde. Lütfen geçerli bir değer girin");
                getPoint();
            }else{
        
                document.getElementById("h").innerText = "Hemşirelik Puanları\n"+pp1 +" puanına göre";
                voidPoint = pp1;
                const pdata = [];
                ta2.forEach((e) => {
                    if(e.min <= voidPoint){
                        pdata.push({
                            location : e.location.replace("T.C. Sağlık Bakanlığı ",""),
                            city: e.city,
                            kont : e.kont,
                            min:e.min,
                            max:e.max,
                            year: 2023
                        })
                    }
                });
                ta1.forEach((e,i) => {
                    if(e.min <= voidPoint){
                        pdata.push({
                            location : e.location.replace("T.C. Sağlık Bakanlığı ",""),
                            city: e.city,
                            kont : e.kont,
                            min:e.min,
                            max:e.max,
                            year: 2024
                        })
                    }  
                })
                pdata.sort((a,b) => a.min - b.min);
                let res = "";
                pdata.forEach((e) => {
                    const htmss = ` <tr>
                        <td  class="y${e.year}">${e.location}</td>
                        <td  class="y${e.year}">${e.city}\n <p>${e.year === 2023 ? "<p>2023 yılına ait veri": ""}</p></td>
                        <td  class="y${e.year}">${e.kont}</td>
                        <td  class="y${e.year}">${e.max}</td>
                        <td  class="y${e.year}">${e.min}</td>
                    </tr>`
                    res += htmss;
                })
                document.getElementById("by").innerHTML = res;
            }
        }
        getPoint();
        document.getElementById("circ").addEventListener("click",() =>{
            const move = confirm("Yeni bir arama yapmak istediğinize emin misiniz?");
            if(move){
                window.location.reload();
            }
        })
       </script>
